def pythonMatMul(n):
    matA = [[1.0 for _ in range(n)] for _ in range(n)]
    matB = [[1.0 for _ in range(n)] for _ in range(n)]
    matC = [[0.0 for _ in range(n)] for _ in range(n)]
    start = time.time()
    for row in range(n):
        for col in range(n):
            for k in range(n):
                matC[row][col] += matA[row][k] * matB[k][col]
    end = time.time()
    return end - start
