def post(theta, y, alpha=1, beta=1):
    if theta <= 1 and theta >= 0:
        prior = stats.beta(alpha, beta).pdf(theta)
        like = stats.bernoulli(theta).pmf(y).prod()
        prob = like * prior
    else:
        prob = -np.inf
    return prob
